import React, { Component } from 'react';

class WindowUser extends Component{

    render() {
        return(
            <div>
                <div>
                    <ul>
                        <li>Perfil</li>
                        <li>Mis viajes</li>
                        <li>Pedir un viaje</li>
                    </ul>
                </div>
                <div></div>
            </div>
        );
    }
}

export default WindowUser;
